// src/pages/Home.js
import React from 'react';
import { View, Text, Image, ScrollView } from 'react-native';
import styles from '../styles/HomeStyles'; // Import styles

const Home = () => {
  return (
    <ScrollView style={styles.container}>
      {/* Header Section */}
      <View style={styles.header}>
        <Text style={styles.headerText}>Natural Skincare Daily Routine</Text>
        <Text style={styles.subHeaderText}>Products that harness the power of 100% natural ingredients.</Text>
        {/* Image section */}
        <View style={styles.imageContainer}>
          <Image
            source={{ uri: 'https://your-image-url.com/image.jpg' }} // Replace with actual image URL
            style={styles.headerImage}
          />
        </View>
      </View>

      {/* Categories Section */}
      <View style={styles.categories}>
        <Text style={styles.sectionTitle}>Popular Categories</Text>
        <ScrollView horizontal>
          <View style={styles.categoryItem}>
            <Image
              source={{ uri: 'https://your-image-url.com/bio-herbal.jpg' }} // Replace with actual image URL
              style={styles.categoryImage}
            />
            <Text style={styles.categoryText}>Bio-Herbal</Text>
          </View>
          {/* Repeat for other categories */}
        </ScrollView>
      </View>

      {/* Product Showcase Section */}
      <View style={styles.productShowcase}>
        <Text style={styles.sectionTitle}>Best of Collection 2022</Text>
        <View style={styles.productItem}>
          <Image
            source={{ uri: 'https://your-image-url.com/product1.jpg' }} // Replace with actual image URL
            style={styles.productImage}
          />
          <Text style={styles.productText}>Product Name</Text>
        </View>
        {/* Repeat for other products */}
      </View>

      {/* Footer Section */}
      <View style={styles.footer}>
        <Text style={styles.footerText}>
          Having a place set aside for an activity you love makes it more likely you'll do it.
        </Text>
      </View>
    </ScrollView>
  );
};

export default Home;
